var ViewModel=function(){var a=this;this.currentCat=ko.observable(new Cat());this.incrementCounter=function(){this.clickCount(this.clickCount()+1)}};var Cat=function(){this.clickCount=ko.observable(0);this.name=ko.observable("Tabby");this.imgSrc=ko.observable("img/cute-little-cat.jpg");this.imgAttribution=ko.observable("http://www.medhatspca.ca/sites/default/files/news_photos/2014-Apr-15/node-147/cute-little-cat.jpg");this.level=ko.computed(function(){var b;var a=this.clickCount();if(a<10){b="Newborn"}else{if(a<50){b="Infant"}else{if(a<100){b="Child"}else{if(a<200){b="Teen"}else{if(a<300){b="Adult"}else{b="Ninja"}}}}}return b},this);this.nicknames=ko.observableArray([{name:"Tony the Tiger"},{name:"Terry the Terrible"},{name:"Spaz"},{name:"Creepy"}])};ko.applyBindings(new ViewModel());